import "./Header.css";
import logo from "./logo.svg";
import html from "./HTML5_logo.svg";
import CSS3_logo from "./CSS3_logo.svg"
import JS_logo from "./JS_logo.svg"

export default function Header() {
  return (
    <header className="App-header">
      <img src={logo} className="App-logo" alt="logo" />
      <img src={html} className="html-logo" alt="logo" />
      <img src={CSS3_logo} className="css-logo" alt="logo" />
      <img src={JS_logo} className="JS-logo" alt="logo" />
    </header>
  );
}
